import React, {useState} from 'react';
import './App.css';
import {Rating, ValueType} from "./Components/Rating";
import {Accordion} from "./Components/Accordion";
import {OnOff} from "./Components/Onoff/OnOff";



function App() {

    const [value,SetValue]=useState<ValueType>(0)
    let [collapsed,setCollapsed]=useState(true)

    const ChangeValue=(setStars: ValueType)=> {
    SetValue(setStars)
    }

const ChangeCollapsed = (collapsed:boolean)=> {
        setCollapsed(collapsed)
}


  return (
    <div className={'App'}>
        <AppTitle title={'This is App component'}/>
        <Accordion collapsed={collapsed} changeCollapsed={()=>setCollapsed(!collapsed)} title={'Menu'} />
        <Accordion collapsed={collapsed} changeCollapsed={()=>ChangeCollapsed(collapsed)}  title={'Hello subscriber'} />
        <Rating  value={value} setValue={ChangeValue}/>

        <OnOff />
        <OnOff />
    </div>
  );
}

type AppTitleType = {
    title:string
}

function AppTitle (props:AppTitleType){
  return (
      <>
          {props.title}
      </>
  )
}




export default App;
